import '../top/HeadBar.css';
import { Grid} from '@material-ui/core'
import logo from '../img/Logo.png'

function HeadBar() {
  return (
        <div className="bg">
          <Grid container >
              <Grid item xs={8} >
                <img src="{logo}"></img>
              </Grid>
              <Grid item xs={4} >About</Grid>
          </Grid>
        </div>
  );
}

export default HeadBar;
